    //Use BFS to solve this problem
    public static int minTotalDistance(int[][] grid) {
        int row = grid.length;
        int col = grid[0].length;
        if(row==0||col==0){
            return 0;
        }
        else{
            int min = Integer.MAX_VALUE;
            int[][] total = new int[row][col];
            for(int i = 0; i<row; i++){
                for(int j = 0; j<col; j++){
                    if(grid[i][j]==1){
                        int[][] visited = new int[row][col];
                        Queue<int[]> index = new LinkedList<int[]>();
                        Queue<Integer> level = new LinkedList<Integer>();
                        int[] p = {i,j};
                        index.offer(p);
                        level.offer(0);
                        while(index.isEmpty()==false){
                            int[] position = index.poll();
                            int levelDist = level.poll();
                            if(visited[position[0]][position[1]]==0){
                                visited[position[0]][position[1]] = 1;
                                total[position[0]][position[1]] += levelDist;
//                                int[] u = {position[0]-1,position[1]};
//                                int[] d = {position[0]+1,position[1]};
//                                int[] l = {position[0],position[1]-1};
//                                int[] r = {position[0],position[1]+1};
//                                index.offer(u);
//                                level.offer(levelDist+1);
//                                index.offer(d);
//                                level.offer(levelDist+1);
//                                index.offer(l);
//                                level.offer(levelDist+1);
//                                index.offer(r);
//                                level.offer(levelDist+1);
                            if(position[0]-1>=0&&visited[position[0]-1][position[1]]==0){
                            	int[] t = {position[0]-1,position[1]};
                            	index.offer(t);
                            	level.offer(levelDist+1);
                            }
                            if(position[0]+1<row&&visited[position[0]+1][position[1]]==0){
                            	int[] t = {position[0]+1,position[1]};
                            	index.offer(t);
                            	level.offer(levelDist+1);
                            }
                            if(position[1]-1>=0&&visited[position[0]][position[1]-1]==0){
                            	int[] t = {position[0],position[1]-1};
                            	index.offer(t);
                            	level.offer(levelDist+1);
                            }
                            if(position[1]+1<col&&visited[position[0]][position[1]+1]==0){
                            	int[] t = {position[0],position[1]+1};
                            	index.offer(t);
                            	level.offer(levelDist+1);
                            }
                            }
                            
//                            visited[position[0]][position[1]]=1;
//                            total[position[0]][position[1]] += levelDist;
//                            if(position[0]-1>=0&&visited[position[0]-1][position[1]]==0){
//                            	int[] t = {position[0]-1,position[1]};
//                            	index.offer(t);
//                            	level.offer(levelDist+1);
//                            }
//                            if(position[0]+1<row&&visited[position[0]+1][position[1]]==0){
//                            	int[] t = {position[0]+1,position[1]};
//                            	index.offer(t);
//                            	level.offer(levelDist+1);
//                            }
//                            if(position[1]-1>=0&&visited[position[0]][position[1]-1]==0){
//                            	int[] t = {position[0],position[1]-1};
//                            	index.offer(t);
//                            	level.offer(levelDist+1);
//                            }
//                            if(position[1]+1<col&&visited[position[0]][position[1]+1]==0){
//                            	int[] t = {position[0],position[1]+1};
//                            	index.offer(t);
//                            	level.offer(levelDist+1);
//                            }
                        }
                    }    
                }
            }
            for(int i = 0; i<row; i++){
                for(int j = 0; j<col; j++){
                    min = Math.min(min,total[i][j]);
                }
            }
            return min;
        }
    }
